create table house_information
(
    address_id           serial not null
        constraint house_information_pkey
            primary key,
    address              varchar(256),
    region               varchar(256),
    city                 varchar(256),
    street               varchar(256),
    status               boolean,
    year_of_occupancy    integer,
    number_of_floors     integer,
    last_update          varchar(256),
    type_of_construction varchar(256),
    house_type           varchar(256),
    wreck_status         boolean,
    cadastral_number     varchar(256),
    type_of_cellings     varchar(256),
    walls_material       varchar(256)
);

alter table house_information
    owner to aydar;

